import React from 'react';
import { BrowserRouter, Route, Link} from 'react-router-dom';

const PageOne= ()=>{
    return (
        <div>
            Page One
            <Link to="/pageTwo">Naviagte to Page Two</Link>
        </div>
    );
}

const PageTwo= ()=>{
    return (
        <div>
            Page Two
            <button>Click Me</button>
            <Link to="/">Naviagte to Page One</Link>
        </div>
    )
}

const App= ()=>{
    return (
        <div>
            <BrowserRouter>
                <div>
                    <Route path="/" exact={true} component= {PageOne} />
                    <Route path="/pageTwo" component= {PageTwo} />
                </div>
            </BrowserRouter>
        </div>
    );
}

export default App;
